    constructor(props) {
        super(props);

    }

    render() {
        return (
        <div className="max-w-screen-md flex flex-col justify-center content-center mx-auto">
            <div className ="sm:hidden
            w-full flex flex-row flex-wrap justify-between items-center
            ">
                <img 
                className="h-7"    
                src={menu}/>
                <a href="/">
                <img src={logo180} alt="logo" 
                    className="
                        h-12 py-3
                        block
                    "
                />
                </a>
                <img
                className="h-7"    
                src={user}/>

            </div>
        </div>


        )
    }
}
